import axios from 'axios'
const baseUrl = 'http://localhost:3000/api/download'

/**
 * 
 * @param {url : string} t채m채 on url josta haetaan kalenteri
 * @param {setKasiteltavaKalenteri : } setKasiteltavaKalenteri 
 */
const download = async (url, setKasiteltavaKalenteri) => {
  console.log("suoriteaan download")
  const parameters = 
    {
      "osoite": url
    } 
    axios.post(baseUrl, parameters)
      .then(response => {
        setKasiteltavaKalenteri(response.data)
      }).catch(err => {
        console.log("something went wroooong")
      })
}


export default { download }
